A connection to a multiplexer made via a unix socket is referred to as a unix domain . Unix domains are supported on all systems, even Windows and are a way to connect the native win32 GUI into the Windows Subsystem for Linux (WSL). The bare minimum configuration to enable a unix domain is this, which will spawn a server if needed and then connect the gui to it automatically when wezterm is launched: return { unix_domains = { { name = "unix", } }, -- This causes `wezterm` to act as though it was started as -- `wezterm connect unix` by default, connecting to the unix -- domain on startup. -- If you prefer to connect manually, leave out this line. default_gui_startup_args = {"connect", "unix"},
} If you prefer to connect manually, omit the default_gui_startup_args setting and then run: $ wezterm connect unix Note that in earlier versions of wezterm, a connect_automatically domain option was shown as the way to connect on startup. Using default_gui_startup_args is recommended instead as it works more reliably. The possible configuration values are: return { unix_domains = { { -- The name; must be unique amongst all domains name = "unix", -- The path to the socket. If unspecified, a resonable default -- value will be computed. -- socket_path = "/some/path", -- If true, do not attempt to start this server if we try and fail to -- connect to it. -- no_serve_automatically = false, -- If true, bypass checking for secure ownership of the -- socket_path. This is not recommended on a multi-user -- system, but is useful for example when running the -- server inside a WSL container but with the socket -- on the host NTFS volume. -- skip_permissions_check = false, } }
} Since: 20220101-133340-7edc5b5a It is now possible to specify a proxy_command that will be used in place of making a direct unix connection. When proxy_command is specified, it will be used instead of the optional socket_path. This example shows a redundant use of nc (netcat) to connect to the unix socket path on my mac. This isn't useful on its own, but may help with the WSL 2 issue mentioned below when translated to an appropriate invocation of netcat/socat on Windows: return { unix_domains = { { name = "unix", proxy_command = {"nc", "-U", "/Users/wez/.local/share/wezterm/sock"}, } }
} Since: 20220319-142410-0fcdea07 You may now specify the round-trip latency threshold for enabling predictive local echo using local_echo_threshold_ms. If the measured round-trip latency between the wezterm client and the server exceeds the specified threshold, the client will attempt to predict the server's response to key events and echo the result of that prediction locally without waiting, hence hiding latency to the user. This option only applies when multiplexing = "WezTerm". return { unix_domains = { { name = "unix", local_echo_threshold_ms = 10, } },
}

