If you'd like wezterm to start running a program in a specific working directory you can do so via the config, CLI, and when using SpawnCommand : Setting the default_cwd via the config: return { default_cwd = "/some/path",
} One off program in a specific working directory via the CLI: wezterm start --cwd /some/path The SpawnCommandInNewTab , and SpawnCommandInNewWindow key assignments, and the Launcher Menu described below all accept a SpawnCommand object that accepts an optional cwd field: { label = "List files in /some/path", args = {"ls", "-al"}, cwd = "/some/path",
} Panes/Tabs/Windows created after the first will generally try to resolve the current working directory of the current Pane, preferring a value set by OSC 7 and falling back to attempting to lookup the cwd of the current process group leader attached to a local Pane. If no cwd can be resolved, then the default_cwd will be used. If default_cwd is not specified, then the home directory of the user will be used. See default_cwd for an easier to understand visualization .

