This escape sequence is was originally defined by iTerm2. It supports setting the value as well as pushing and popping the value on a stack, which is helpful when temporarily adjusting the value. OSC 1337 ; UnicodeVersion=N ST The above sets the unicode version to N, where N is the integer version number. OSC 1337 ; UnicodeVersion=push ST Pushes the current version onto a stack. OSC 1337 ; UnicodeVersion=pop ST Pops the last-pushed version from the stack and sets the unicode version to that value. If there were no entries on the stack, the unicode version is left unchanged. OSC 1337 ; UnicodeVersion=push LABEL ST Pushes the current version onto a stack, labeling it with LABEL. OSC 1337 ; UnicodeVersion=pop LABEL ST Pops entries from the stack stopping after an entry labelled with LABEL is popped. The labels are helpful when writing a wrapper alias, for example: function run_with_unicode_version_9() { local label=$(uuidgen) printf "\e]1337;UnicodeVersion=push %s\e\\" $label printf "\e]1337;UnicodeVersion=9\e\\" eval $@ local result=${PIPESTATUS[0]} printf "\e]1337;UnicodeVersion=pop %s\e\\" $label return $result
} # Connect to a remote machine with an older version of unicode
run_with_unicode_version_9 ssh remote.machine Will save the current version on the stack with a unique label, then set the version to 9 and spawn the requested command. When the command returns it will restore the saved version, even if the command itself set or pushed other values.

