The launcher menu is accessed from the new tab button in the tab bar UI; the + button to the right of the tabs. Left clicking on the button will spawn a new tab, but right clicking on it will open the launcher menu. You may also bind a key to the ShowLauncher or ShowLauncherArgs action to trigger the menu. The launcher menu by default lists the various multiplexer domains and offers the option of connecting and spawning tabs/windows in those domains. You can define your own entries using the launch_menu configuration setting. The snippet below adds two new entries to the menu; one that runs the top program to monitor process activity and a second one that explicitly launches the bash shell. Each entry in launch_menu is an instance of a SpawnCommand object. return { launch_menu = { { args = {"top"}, }, { -- Optional label to show in the launcher. If omitted, a label -- is derived from the `args` label = "Bash", -- The argument array to spawn. If omitted the default program -- will be used as described in the documentation above args = {"bash", "-l"}, -- You can specify an alternative current working directory; -- if you don't specify one then a default based on the OSC 7 -- escape sequence will be used (see the Shell Integration -- docs), falling back to the home directory. -- cwd = "/some/path" -- You can override environment variables just for this command -- by setting this here. It has the same semantics as the main -- set_environment_variables configuration option described above -- set_environment_variables = { FOO = "bar" }, }, }
} Here's a fancy example that will add some helpful entries to the launcher menu when running on Windows: since: 20200607-144723-74889cd4 : The launcher menu automatically includes WSL entries by default, unless disabled using add_wsl_distributions_to_launch_menu = false. local wezterm = require 'wezterm'; local launch_menu = {} if wezterm.target_triple == "x86_64-pc-windows-msvc" then table.insert(launch_menu, { label = "PowerShell", args = {"powershell.exe", "-NoLogo"}, }) -- Find installed visual studio version(s) and add their compilation -- environment command prompts to the menu for _, vsvers in ipairs(wezterm.glob("Microsoft Visual Studio/20*", "C:/Program Files (x86)")) do local year = vsvers:gsub("Microsoft Visual Studio/", "") table.insert(launch_menu, { label = "x64 Native Tools VS " .. year, args = {"cmd.exe", "/k", "C:/Program Files (x86)/" .. vsvers .. "/BuildTools/VC/Auxiliary/Build/vcvars64.bat"}, }) end -- Enumerate any WSL distributions that are installed and add those to the menu local success, wsl_list, wsl_err = wezterm.run_child_process({"wsl.exe", "-l"}) -- `wsl.exe -l` has a bug where it always outputs utf16: -- https://github.com/microsoft/WSL/issues/4607 -- So we get to convert it wsl_list = wezterm.utf16_to_utf8(wsl_list) for idx, line in ipairs(wezterm.split_by_newlines(wsl_list)) do -- Skip the first line of output; it's just a header if idx > 1 then -- Remove the "(Default)" marker from the default line to arrive -- at the distribution name on its own local distro = line:gsub(" %(Default%)", "") -- Add an entry that will spawn into the distro with the default shell table.insert(launch_menu, { label = distro .. " (WSL default shell)", args = {"wsl.exe", "--distribution", distro}, }) -- Here's how to jump directly into some other program; in this example -- its a shell that probably isn't the default, but it could also be -- any other program that you want to run in that environment table.insert(launch_menu, { label = distro .. " (WSL zsh login shell)", args = {"wsl.exe", "--distribution", distro, "--exec", "/bin/zsh", "-l"}, }) end end
end return { launch_menu = launch_menu,
}

