The GNOME desktop environment provides the gsettings tool that can inform us of the selected appearance even in a Wayland session. We can substitute the call to window:get_appearance above with a call to the following function, which takes advantage of this: function query_appearance_gnome() local success, stdout = wezterm.run_child_process( {"gsettings", "get", "org.gnome.desktop.interface", "gtk-theme"} ) -- lowercase and remove whitespace stdout = stdout:lower():gsub("%s+", "") local mapping = { highcontrast = "LightHighContrast", highcontrastinverse = "DarkHighContrast", adwaita = "Light", ["adwaita-dark"] = "Dark" } local appearance = mapping[stdout] if appearance then return appearance end if stdout:find("dark") then return "Dark" end return "Light"
end Since WezTerm will not fire a window-config-reloaded event on Wayland, you will instead need to listen on the update-right-status event, which will essentially poll for the appearance periodically: local wezterm = require 'wezterm' function scheme_for_appearance(appearance) if appearance:find("Dark") then return "Builtin Solarized Dark" else return "Builtin Solarized Light" end
end wezterm.on("update-right-status", function(window, pane) local overrides = window:get_config_overrides() or {} local appearance = query_appearance_gnome() local scheme = scheme_for_appearance(appearance) if overrides.color_scheme ~= scheme then overrides.color_scheme = scheme window:set_config_overrides(overrides) end
end) return {
