Rather than using a color scheme, you can specify the color palette using the colors configuration section. Note that color_scheme takes precedence over this section. You can configure colors with a section like this. In addition to specifying SVG/CSS3 color names , you can use #RRGGBB to specify a color code using the usual hex notation; eg: #000000 is equivalent to black: return { colors = { -- The default text color foreground = "silver", -- The default background color background = "black", -- Overrides the cell background color when the current cell is occupied by the -- cursor and the cursor style is set to Block cursor_bg = "#52ad70", -- Overrides the text color when the current cell is occupied by the cursor cursor_fg = "black", -- Specifies the border color of the cursor when the cursor style is set to Block, -- or the color of the vertical or horizontal bar when the cursor style is set to -- Bar or Underline. cursor_border = "#52ad70", -- the foreground color of selected text selection_fg = "black", -- the background color of selected text selection_bg = "#fffacd", -- The color of the scrollbar "thumb"; the portion that represents the current viewport scrollbar_thumb = "#222222", -- The color of the split lines between panes split = "#444444", ansi = {"black", "maroon", "green", "olive", "navy", "purple", "teal", "silver"}, brights = {"grey", "red", "lime", "yellow", "blue", "fuchsia", "aqua", "white"}, -- Arbitrary colors of the palette in the range from 16 to 255 indexed = {[136] = "#af8700"}, -- Since: 20220319-142410-0fcdea07 -- When the IME, a dead key or a leader key are being processed and are effectively -- holding input pending the result of input composition, change the cursor -- to this color to give a visual cue about the compose state. compose_cursor = "orange", }
} Since: 20220101-133340-7edc5b5a You may specify colors in the HSL color space, if you prefer that over RGB, by using: return { colors = { -- the first number is the hue measured in degrees with a range -- of 0-360. -- The second number is the saturation measured in percentage with -- a range of 0-100. -- The third number is the lightness measured in percentage with -- a range of 0-100. foreground = "hsl:235 100 50", }
} Since: 20220319-142410-0fcdea07 Colors now also accept the following CSS-style color specifications: #00ff00ff
rgb(0,255,0)
rgb(0% 100% 0%)
rgb(0 255 0 / 100%)
rgba(0,255,0,1)
hsl(120,100%,50%)
hsl(120deg 100% 50%)
hsl(-240 100% 50%)
hsl(-240deg 100% 50%)
hsl(0.3333turn 100% 50%)
hsl(133.333grad 100% 50%)
hsl(2.0944rad 100% 50%)
hsla(120,100%,50%,100%)
hwb(120 0% 0%)
hwb(480deg 0% 0% / 100%)
hsv(120,100%,100%)
hsv(120deg 100% 100% / 100%) The alpha value is ignored except when used with selection_fg and selection_bg: return { colors = { -- Make the selection text color fully transparent. -- When fully transparent, the current text color will be used. selection_fg = "none", -- Set the selection background color with alpha. -- When selection_bg is transparent, it will be alpha blended over -- the current cell background color, rather than replace it selection_bg = "rgba(50% 50% 50% 50%)" }
}

