The tab bar has two modes; the default is a native looking style, but is is also possible to enable a retro aesthetic. The configuration for the two styles is broadly similar, but there are a few different details. use_fancy_tab_bar option controls which tab bar style is used. enable_tab_bar option control whether the tab bar is used at all. hide_tab_bar_if_only_one_tab option causes the tab bar to be hidden when there is only a single tab. tab_bar_at_bottom places the tab bar at the bottom of the window instead of the top tab_max_width sets the maximum width, measured in cells, of a given tab when using retro tab mode. Native (Fancy) Tab Bar appearance The following options affect the fancy tab bar: local wezterm = require 'wezterm' return { window_frame = { -- The font used in the tab bar. -- Roboto Bold is the default; this font is bundled -- with wezterm. -- Whatever font is selected here, it will have the -- main font setting appended to it to pick up any -- fallback fonts you may have used there. font = wezterm.font({family="Roboto", weight="Bold"}), -- The size of the font in the tab bar. -- Default to 10. on Windows but 12.0 on other systems font_size = 12.0, -- The overall background color of the tab bar when -- the window is focused active_titlebar_bg = "#333333", -- The overall background color of the tab bar when -- the window is not focused inactive_titlebar_bg = "#333333", }, colors = { tab_bar = { -- The color of the inactive tab bar edge/divider inactive_tab_edge = "#575757", }, },
} In addition, the tab bar colors mentioned below also apply to the items displayed in the tab bar. Retro Tab Bar appearance The following options control the appearance of the tab bar: return { colors = { tab_bar = { -- The color of the strip that goes along the top of the window -- (does not apply when fancy tab bar is in use) background = "#0b0022", -- The active tab is the one that has focus in the window active_tab = { -- The color of the background area for the tab bg_color = "#2b2042", -- The color of the text for the tab fg_color = "#c0c0c0", -- Specify whether you want "Half", "Normal" or "Bold" intensity for the -- label shown for this tab. -- The default is "Normal" intensity = "Normal", -- Specify whether you want "None", "Single" or "Double" underline for -- label shown for this tab. -- The default is "None" underline = "None", -- Specify whether you want the text to be italic (true) or not (false) -- for this tab. The default is false. italic = false, -- Specify whether you want the text to be rendered with strikethrough (true) -- or not for this tab. The default is false. strikethrough = false, }, -- Inactive tabs are the tabs that do not have focus inactive_tab = { bg_color = "#1b1032", fg_color = "#808080", -- The same options that were listed under the `active_tab` section above -- can also be used for `inactive_tab`. }, -- You can configure some alternate styling when the mouse pointer -- moves over inactive tabs inactive_tab_hover = { bg_color = "#3b3052", fg_color = "#909090", italic = true, -- The same options that were listed under the `active_tab` section above -- can also be used for `inactive_tab_hover`. }, -- The new tab button that let you create new tabs new_tab = { bg_color = "#1b1032", fg_color = "#808080", -- The same options that were listed under the `active_tab` section above -- can also be used for `new_tab`. }, -- You can configure some alternate styling when the mouse pointer -- moves over the new tab button new_tab_hover = { bg_color = "#3b3052", fg_color = "#909090", italic = true, -- The same options that were listed under the `active_tab` section above -- can also be used for `new_tab_hover`. } } }
}

