since: 20201031-154415-9614e117 You can attach an image to the background of the wezterm window: return { window_background_image = "/path/to/wallpaper.jpg"
} If the path is a relative path then it will be expanded relative to the directory containing your wezterm.lua config file. PNG, JPEG, GIF, BMP, ICO, TIFF, PNM, DDS, TGA and farbfeld files can be loaded. Animated GIF and PNG files will animate while the window has focus. The image will be scaled to fit the window contents. Very large images may decrease render performance and take up VRAM from the GPU, so you may wish to resize the image file before using it. You can optionally transform the background image by specifying a hue, saturation, brightness multiplier: return { window_background_image = "/path/to/wallpaper.jpg", window_background_image_hsb = { -- Darken the background image by reducing it to 1/3rd brightness = 0.3, -- You can adjust the hue by scaling its value. -- a multiplier of 1.0 leaves the value unchanged. hue = 1.0, -- You can adjust the saturation also. saturation = 1.0, },
} See Styling Inactive Panes for more information on hue, saturation, brigthness transformations.
